import React from "react";
import { Datagrid, TextField, ReferenceField, List } from "react-admin";

export const AjudanteList = props => (
  <List
    bulkActionButtons={false}
    actions={false}
    filter={{ usuarioId: localStorage.getItem("user_id") }}
    {...props}
  >
    <Datagrid rowClick={false}>
      <ReferenceField
        label="Nome do evento"
        reference="Eventos"
        source="eventoId"
        linkType="show"
      >
        <TextField label="nome" source="nome" />
      </ReferenceField>
    </Datagrid>
  </List>
);

export default AjudanteList;
